import React from "react";
import Card from "@material-ui/core/Card";
import cartProductStyles from "styles/cartProduct";
import CardMedia from "@material-ui/core/CardMedia";
import { makeStyles } from "@material-ui/core/styles";
import Typography from "@material-ui/core/Typography";
import CardActions from "@material-ui/core/CardActions";
import Button from "@material-ui/core/Button";
import ButtonGroup from "@material-ui/core/ButtonGroup";

const useStyles = makeStyles(theme => cartProductStyles(theme));

const CartProduct = props => {
  const { productInfo, onClickHandler } = props,
    { name, image, price, description } = productInfo;

  const classes = useStyles();

  return (
    <Card className={classes.card}>
      <CardMedia
        className={classes.media}
        image={require(`assets/images/${image}`)}
        alt={image}
        title={image}
      />

      <CardActions className={classes.actionItems}>
        <Typography className={classes.price} component="span">
          {price}
        </Typography>
        <ButtonGroup size="small" className={classes.buttonGroup}>
          <Button >+</Button>
          <Button >{}</Button>
          <Button >-</Button>
        </ButtonGroup>
      </CardActions>
    </Card>
  );
};

export default CartProduct;
